import { TableRow } from "./TableRow"

export const ListOfEntries = ({ data }) => {


    return (
        <section id="list-of-entries">
            <table>
                <thead>
                    <tr>
                        <th>Bedrijfsnaam</th>
                        <th>Adres</th>
                        <th>Postcode</th>

                        <th>Woonplaats</th>

                        <th>Website</th>

                    </tr>
                </thead>
                <tbody>
                    {data.map(function (entry) {
                        return (
                            <TableRow key={entry.Adres} entry={entry} />
                        )
                    })}
                </tbody>
            </table >

        </section>
    )
}
